import React, { Component } from 'react';

class Users extends Component {
  state = {
    users: [
      {
        id: 'id',
        login: 'mojombo',
        avatar_url: 'https://avatars0.githubusercontent.com/u/1?v=4',
        html_url: 'https://github.com/mojombo'
      },

      {
        id: 'id',
        login: 'topfunky',
        avatar_url: 'https://avatars3.githubusercontent.com/u/26?v=4',
        html_url: 'https://github.com/topfunky'
      },
      {
        id: 'id',
        login: 'caged',
        avatar_url: 'https://avatars3.githubusercontent.com/u/25?v=4',
        html_url: 'https://github.com/caged'
      }
    ]
  };
  render() {
    return (
      <div>
        {this.state.users.map(users => {
          <div className="card text-center">
            <img
              src={users.avatar_url}
              className="round-img"
              style={{ width: '60px' }}
            ></img>
            <h3>{user.login}</h3>
            <div>
              <a href={user.html_url} className="btn btn-dark btn-sm my-1">
                More
              </a>
            </div>
          </div>;
        })}
      </div>
    );
  }
}

export default Users;
